def numdigits(n: int) -> int:
    return math.floor(math.log10(n)) + 1

def blinksingle(s) -> list:
    new = []
    if s == 0:
        return [1]
    d = numdigits(s)
    if d % 2 == 0:
        r = (10 ** (int(d / 2)))
        new.append(s // r)
        new.append(s % r)
    else:
        new.append(s * 2024)
    return new

def blink(stones):
    new = []
    for s in stones:
        new.extend(blinksingle(s))
    return new



