def recblink(stones, itsleft):
    # memo
    if (stones, itsleft) in memo:
        #print(f"memo hit: {stones, itsleft} -> {memo[(stones, itsleft)]}")
        return memo[(stones, itsleft)]
    # base case

    outstones = []

    if (itsleft == 1) and (len(stones) == 1):
        s = stones[0]
        if s == 0:
            return 1
        d = numdigits(s)
        if d % 2 == 0:
            # r = (10 ** (int(d / 2)))
            # outstones.append(s//r)
            # outstones.append(s%r)
            return 2
        else:
            # outstones.append(s * 2024)
            return 1
    else:
        for s in stones:
            outstones.extend(blinksingle(s))
    # recursion
    #print(f"{outstones=}")
    res = sum([recblink(tuple([s]), itsleft-1) for s in outstones])
    #print(stones, itsleft, res)
    memo[(stones, itsleft)] = res
    return res




